namespace common\utils;


class IDOCR extends TencentAI
{

	static $url = 'https://api.ai.qq.com/fcgi-bin/ocr/ocr_idcardocr';

	public static function ID_identify($path = '')
	{
		// 文档: https://ai.qq.com/doc/ocridcardocr.shtml
		// 设置请求数据
		// 图片base64编码
		// $data = file_get_contents($path);
		// $base64 = base64_encode($data);
		$base64 = "data:image/jpeg;base64,";


		// 设置请求数据
		$params = array(
			'app_id' => self::APPID,
			'image' => $base64,
			'card_type' => '0',
			'time_stamp' => strval(time()),
			'nonce_str' => strval(rand()),
			'sign' => '',
		);
		$params['sign'] = self::getReqSign($params);

		// 执行API调用
		$response = self::doHttpPost($params, self::$url);
		echo $response;

//		return self::after_respone($response);
	}

	public static function after_respone($response)
	{
		if (!$response) {
			return '系统错误';
		}
		$response = AppUtil::json_decode($response);
		// print_r($response);
		if (!is_array($response)
			|| !array_key_exists('ret', $response)) {
			return '系统错误~';
		}

		if ($response['ret'] == 0) {
			return $response['data']['answer'] ?? '~~';
		} else {
			return self::$error_map[$response['ret']] ?? '--';
		}

	}


}